import React from 'react';

const style = {
    background: "d35e0f",
    color: "fff",
    border: "none",
    padding: "3px 7px",
    cursor: "pointer",
    float: "right",
    outline: "none",
    marginRight: "5px"

}
class Priority extends React.Component  {

    render(){
    return(
    <select style={style} onChange={this.props.onChangeHandler} defaultValue={'DEFAULT'}>
            <option style={{background:"white"}} value="DEFAULT" disabled>Priority</option>
            <option value="High">High</option>
            <option value="Medium">Medium</option>
            <option value="Low">Low</option>
    </select>
    )}
}

export default Priority;
